import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import { Typography, TextField } from '@material-ui/core';

const styles = {
    header: {
        fontSize: 22,
        color: "black",
        align: "center"

    }
}

export default class DataTable extends React.Component {
    createData(type, leistung, einheit, jahr1, jahr2, jahr3, jahr4, jahr5, jahr6, jahr7, jahr8, jahr9, jahr10) {
        return { type, leistung, einheit, jahr1, jahr2, jahr3, jahr4, jahr5, jahr6, jahr7, jahr8, jahr9, jahr10 };
    }
    render() {
        const rows = [
            this.createData('Wasserstoff', 'Einspeiseleistung', 'MWh/hth', <TextField style={{ width: '100%' }} />, <TextField />, <TextField />, <TextField />, <TextField />, <TextField />, <TextField />, <TextField />, <TextField />),
            this.createData('Wasserstoff', 'Einspeisemenge pro Jahr', 'MWh/hth', <TextField />, <TextField />),
            this.createData('Wasserstoff', 'Ausspeiseleistung', 'MWh/hth', <TextField />, <TextField />),
            this.createData('Wasserstoff', 'Ausspeisemenge pro Jahr', 'MWh/hth', <TextField />, <TextField />),
            this.createData('Synthetisches Methan', 'Einspeiseleistung', 'MWh/hth', <TextField />, <TextField />),
            this.createData('Synthetisches Methan', 'Einspeisemenge pro Jahr', 'MWh/hth', <TextField />, <TextField />),
            this.createData('Biomethan', 'Einspeiseleistung', 'MWh/hth', <TextField />, <TextField />),
            this.createData('Biomethan', 'Einspeisemenge pro Jahr', 'MWh/hth', <TextField />, <TextField />),
            this.createData('Bei geplanter Elektrolyse:', 'Elektrische Leistung der Anlage', 'MWh/hth', <TextField />, <TextField />),
        ];
        return (
            <TableContainer component={Paper}>
                <Table aria-label="simple table">
                    <TableHead>
                        <TableRow>
                            <TableCell style={styles.header}>Punktart</TableCell>
                            <TableCell style={styles.header}>Ein-/Ausspeisung (Bitte Angaben als Brennwert)</TableCell>
                            <TableCell style={styles.header}>Einheit</TableCell>
                            <TableCell style={styles.header}>2023</TableCell>
                            <TableCell style={styles.header}>2024</TableCell>
                            <TableCell style={styles.header}>2025</TableCell>
                            <TableCell style={styles.header}>2026</TableCell>
                            <TableCell style={styles.header}>2027</TableCell>
                            <TableCell style={styles.header}>2028</TableCell>
                            <TableCell style={styles.header}>2029</TableCell>
                            <TableCell style={styles.header}>2030</TableCell>
                            <TableCell style={styles.header}>2031</TableCell>
                            <TableCell style={styles.header}>2032</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {rows.map((row) => (
                            <TableRow key={row.name}>
                                <TableCell component="th" scope="row">
                                    {row.name}
                                </TableCell>
                                <TableCell >{row.type}</TableCell>
                                <TableCell >{row.leistung}</TableCell>
                                <TableCell >{row.einheit}</TableCell>
                                <TableCell style={{ backgroundColor: "red" }}>{row.jahr1}</TableCell>
                                <TableCell >{row.jahr2}</TableCell>
                                <TableCell >{row.jahr3}</TableCell>
                                <TableCell >{row.jahr4}</TableCell>
                                <TableCell >{row.jahr5}</TableCell>
                                <TableCell >{row.jahr6}</TableCell>
                                <TableCell >{row.jahr7}</TableCell>
                                <TableCell >{row.jahr8}</TableCell>
                                <TableCell >{row.jahr9}</TableCell>
                                <TableCell >{row.jahr10}</TableCell>
                            </TableRow>
                            //type, leistung, einheit, jahr1, jahr2, jahr3, jahr4, jahr5, jahr6, jahr7, jahr8, jahr9, jahr10
                        ))}
                    </TableBody>
                </Table >
            </TableContainer >
        )
    }
}
